import React, { Component } from 'react';
import { connect } from 'react-redux';

class AssignStudentForm extends Component {
    render() {

        console.log(this.props.studentList)
        const studentList = this.props.studentList && this.props.studentList.map(student => {
            return <p>{student.user.firstName} {student.user.lastName}</p>
        })

        const length = this.props.editCourse.name ? " - " + studentList.length : null

        return (
            <div>
                <h4>{this.props.editCourse.name} {length}</h4>
                {studentList}
            </div>
        );
    }
}

const mapStateToProps = state => ({
    studentList: state.temp.studentList,
    editCourse: state.temp.editCourse
})

export default connect(mapStateToProps, {})(AssignStudentForm);
